import React from "react";
import Axios from "axios";
import ModalDelete from "./ModalDelete";

const DELETE_ADDRESS = "http://localhost:5000/orders/delete/";

const DeleteButton = ({ polling, setPolling, orderObject }) => {
  // States
  const [deleteOpen, setDeleteOpen] = useState(false);

  // Functions
  const deleteMe = () => {
    console.log(orderObject._id);
    Axios.delete(DELETE_ADDRESS + orderObject._id)
      .then(function (response) {
        console.log("Order deleted!");
        console.log(response.data);
        setPolling(!polling);
      })
      .catch(function (error) {
        console.log(error);
      });
  };

  return (
    <React.Fragment>
      <ModalDelete />
      <button onClick={deleteMe} className="delete-button">
        DEL
      </button>
    </React.Fragment>
  );
};

export default DeleteButton;
